  \"retail-monitoring-data-collection\",\n\t\"isopen\": false,\n\t\"url\": null,\n\t\"notes\":
  \"This database contains a time series of consumer-level prices for a sample of
  retail markets in Honolulu between 2007-2011. Data include weekly prices for fish
  species prevalent in Honolulu retail seafood markets. Additionally, each record
  contains information on the product form, origin of the fish (if known), labelling
  schemes, quality (where applicable), and the use of preservation methods (such as
  CO-treatment).\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"temporal-extent-begin\",\n\t\t\"value\":
